  USDA purchases a variety of food including fruits, vegetables, meat, grains, and
  dairy products to be distributed directly to needy households or for use in congregate
  feeding programs that help Americans obtain access to nutritious food and support
  American agriculture. This report contains nutrient and food group analyses of the
  USDA Food distributed through NSLP, CACFP, CSFP, FDPIR, and TEFAP in fiscal year
  2009.\",\n\t\"owner_org\": \"4ae51f6c-467a-4f9d-b40a-2c52e83c326a\",\n\t\"extras\":
